	public static int lengthOfLongestSubstring(String s) {
		HashMap<Character, Integer> map = new HashMap<Character, Integer>();

		int max = 0, current = 0;
		for (int i = 0; i < s.length(); i++) {
			char c = s.charAt(i);
			if (map.containsKey(c)) {
				// Restart to find longest substring without repeating
				// characters
				i = map.get(c);
				current = 0;
				map.clear();
			} else {
				current++;
				if (current > max) {
					max = current;
				}
				map.put(c, i);
			}
		}

		return max;
	}
